import React, { Component } from "react";
import PostDataService from "../../services/posts.js";

export default class Blog extends Component {
  state = {
    posts: [],
  };

  getPosts = () => {
    PostDataService.getAll().then((response) => {
      this.setState({ posts: response.data.posts });
    });
  };
  render() {
    return <h1>Blog</h1>;
  }
}
